```cpp
#include <iostream>
#include <fstream>
#include <string>

int main() {
    std::string filePath = "yourfile.txt"; // Replace with your file path
    std::string wordToCount = "yourword"; // Replace with the word you want to count

    std::ifstream file(filePath);
    if (!file.is_open()) {
        std::cerr << "Error: Unable to open file." << std::endl;
        return 1;
    }

    int count = 0;
    std::string line;

    while (file.is_open()) {
        std::getline(file, line);
        if (line.find(wordToCount) == std::string::npos) {
            continue; // Skip lines that do not contain the word
        }
        count++;
    }

    std::cout << "The word \"" << wordToCount << "\" appears " << count << " times in the file." << std::endl;

    file.close();
    return 0;
}
```

