5. **Read and process each line**: The program reads the file line by line using a `while` loop. For each line, it checks if the word exists using `line.find(wordToCount)`. If the word is not found, the line is skipped using `continue`.
6. **Increment the count**: If the word is found, the `count` is incremented by one.
7. **Output the result**: After processing all lines, the program prints the total number of occurrences of the specified word.
8. **Close the file**: The file is closed after processing.

